import { configureStore, createStore } from "@reduxjs/toolkit";
import rootReducer from "./reducer";
import { priceApiCGC } from "./reducer";


export default configureStore({
    reducer: {
        filters: rootReducer,
        [priceApiCGC.reducerPath]: priceApiCGC.reducer,
    },
})
